طريقة التحضير :

يتم تقشير البطاطس وتقطيعها إلى شرائح رقيقة جدًا. ثم تحفظ في ماء بارد لمدة 5 دقائق لتحرير النشا وتجفيفها بمنشفة ورقية بعد ترشيحها. ثم يضاف دقيق الذرة والملح ويوضع في مقلاة بالزيت ويطهى على نار خفيفة لمدة 10-15 دقيقة حتى تصبح البطاطس طرية. أخيرًا نقلب البطاطس ع الجهتين حتي تستوي و بالعافيه 💛 😍
